import React from 'react';

import classes from './Header.module.css';

import mealsImage from '../assets/meals.jpg';

const Header = () => {
    return (
        <>
            <header className={classes.header}>
                <h1>ReactMeals</h1>
            </header>
            <div>
                <img src={mealsImage} alt='mealsImage' />
            </div>
        </>
    );
}

export default Header;
